import React from "react";
import { FinanceRenderComponent } from "./Renders/finance.render";

export class FinancialManagerComponent extends React.Component{
    constructor(props){
        super(props);
        this.state={
            userdata : JSON.parse(sessionStorage.getItem("userData"))
        }
        console.log(this.state.userdata);
    }
    render(){
        return(
            <>
            <table className="table">
                <tbody>
                    <thead className="thead-dark">
                            <tr>
                                <th>Reimbursement ID</th>
                                <th>Description</th>
                                <th>Amount</th>
                                <th>Type</th>
                                <th>Status</th>
                                <th>Submitted</th>
                                <th>Role</th>
                            </tr>
                    </thead>

                        {
                        this.state.userdata.map(tickets=>(
                            <FinanceRenderComponent key={tickets.reimbursementID} ticket={tickets}/>
                        ))
                        }
                </tbody>
            </table>


            </>
        )
    }

}
